const Payment = ({...props}) => {
    console.log(props.data.id)
    if(props && props.data.id) {
        return (
            <>  
                <h1>Оплата {props.operatorName}</h1>
                <form method="POST">
                    <input name="phone" type="text"></input>
                    
                </form>
            </>
        )
    } else {
        return <h1>404</h1>
    }
}

export default Payment
